import React from "react";
import { Pie } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";

const Beer = () => {

  const asdf = {
    dataPie: {
      labels: ["IPA", "Sour Ale", "Saison", "Stout", "Porter", "Brown Ale", "Big Brewery Lager", "Craft Lager", "Pilsner", "Cider"],
      datasets: [
        {
          data: [11, 11, 11, 11, 11, 11, 11, 11, 11, 11, 11],
          backgroundColor: [
            "red",
            "blue",
            "yellow",
            "green",
            "brown",
            "orange",
            "purple",
            "pink",
            "lime",
            "navy",
            "maroon"
          ],
          hoverBackgroundColor: [
            "#FF5A5E",
            "#5AD3D1",
            "#FFC870",
            "#A8B3C5",
            "#616774",
            "#DA92DB"
          ]
        }
      ]
    }
  }

  return (
    <div className="container">
        <div className="row">
          <div className="col-12 text-center">
            <h1>Beer</h1>
            <p>coming soon</p>
          </div>
          <div className="col-12">
            <MDBContainer>
              <h3 className="mt-5">Types of Beer</h3>
              <Pie data={asdf.dataPie} options={{ responsive: true }} />
            </MDBContainer>
          </div>
        </div>
    </div>
  )
}

export default (Beer);
